package me.surendra.leetcode.string.anagram;

import org.junit.Test;

import static me.surendra.leetcode.string.anagram.MinSteps.minStepsToMake2StringAnagramUsingCharArray;
import static me.surendra.leetcode.string.anagram.MinSteps.minStepsToMake2StringAnagramUsingMap;
import static org.hamcrest.Matchers.equalTo;
import static org.junit.Assert.assertThat;


public class MinStepsTest {

    private int callMethod(final String bab, final String aba) {
        return minStepsToMake2StringAnagramUsingCharArray(bab, aba);
//        return minStepsToMake2StringAnagramUsingMap(bab, aba);
    }

    @Test
    public void minStepsToMake2StringAnagramTest() {
        assertThat(callMethod("bab", "aba"), equalTo(1));
        assertThat(callMethod("leetcode", "practice"), equalTo(5));
        assertThat(callMethod("anagram", "mangaar"), equalTo(0));
        assertThat(callMethod("xxyyzz", "xxyyzz"), equalTo(0));
        assertThat(callMethod("", ""),
            equalTo(50000));
    }

}
